  createTNode: function (word, flag, nodes) {
    var node = {}
    node.word = word || ''
    flag < 0 ? node.flag = 0 : node.flag = 1
    node.nodes = nodes || {}
    return node
  },
  /**
  * add sw in the tree
  * @param {String, sensitive words} sentences 
  */
  addWord : function (sentences) {
    if(!sentences) return
    const len = sentences.length
    sentences = sentences.toLowerCase()
    // init rootNode
    const rootNode = sentences.charAt(0)
    // just one word
    if(len===1){
        m_map[rootNode] = this.createTNode(rootNode,1,{})
        return
    }
    if(!m_map[rootNode])
        m_map[rootNode] = this.createTNode(rootNode,0,{})
    var _map = m_map[rootNode]
    for(var i=1; i<len; i++) {
        var _pre = sentences.charAt(i-1),
            _cur = sentences.charAt(i),
            _node = this.createTNode(_cur,i-len+1,{});

        _map.nodes[_cur] = _node
        _map = _map.nodes[_cur]
    }
  },
  /**
   * filter and replace it by "*" 
   * @param {String, your sentence} sentence
   * if return -1, mean input error 
   */
  filter: function (sentence) {
  	this.BuildMap()
    if(!sentence) return -1;
    const len = sentence.length
    const m = m_map
    // [a-zA-Z] convert to [a-z]
    sentence = sentence.toLowerCase().split('');
    for(let i=0; i<len; i++) {
        let w = sentence[i]
        if(m[w]) {
            // state transition
            let curState = m[w]
            for(let j=i+1; j<len; ) {
                // next word
                let nw = sentence[j]
                if(curState.nodes[nw]) {
                    // if it matches a sensitive word
                    if(curState.nodes[nw].flag === 1) {
                        // replace
                        for(i;i<=j;i++)
                            sentence[i] = '*'
                        // continue to judge until i equals len
                        i = j
                        break
                    }else{
                        curState = curState.nodes[nw]
                        j++
                    }
                }else {
                    break
                }
            }
        }
    }
    return sentence.join('')
  },
  BuildMap: function () {
  	var datas = this.sensitiveWords()
    datas.forEach((val)=>{
        this.addWord(val);
    });
  }, 
  Destroy: function () {
      this.m_wordList = null
      m_map = null
  }
